  const[counter,Setcounter]=useState([]);
  return (
    <>
       <div className='App'>
        <button onClick={()=>{
          Setcounter([...counter,{count:counter.length+1}])
          console.log(counter);
        }}>ADD</button>
      </div>
      <div style={{
        width:"100px",
        height:"50px",
        backgroundColor:"lavender",
        top:"20px"
      }}>{counter.count.count}</div>
    </>

  );

}

export default App;
